(1, 'CO-28', 'My path at XYZ', 'Namrata Joshi', 'Senior Quality Analyst', 'Gurgaon', '<p><strong>My path at XYZ</strong></p>\r\n\r\n<p><strong>&quot;</strong>&nbsp;XYZ gives you the platform to showcase your capability and to be competitive. If you work hard and are kind, amazing things will happen &quot;</p>\r\n\r\n<ul>\r\n	<li><strong>Joined as Consultant in November 2013</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Worked as a Spotfire Developer</p>\r\n\r\n<ul>\r\n	<li><strong>Worked as Tableau Developer in January 2014</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;For one of the Customer Experience project</p>\r\n\r\n<ul>\r\n	<li><strong>Worked as a Technical Lead in October 2014</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;For Global Business Service Analytics</p>\r\n\r\n<ul>\r\n	<li><strong>Technical Lead of Customer Intelligence project in November 2015</strong></li>\r\n	<li><strong>My life at XYZ&nbsp;</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;I joined XYZ in 2013 and since then it has been an exciting&nbsp;journey. XYZ gave me the&nbsp;opportunity to not only grow in my core technical skills but also helped develop leadership skill&nbsp;sets. I also got the opportunity to work with well-informed counterparts which took my&nbsp;knowledge and thought process to the next level and helped me win many awards.</p>\r\n\r\n<ul>\r\n	<li><strong>My usual work day </strong>???????</li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;My day starts with listening to melodious songs while performing yoga. Later, with a cup of&nbsp;coffee, I check my mails. On reaching office I create a to-do&nbsp;list of the day and start working on&nbsp;them. My work demands collaborating with the US team which require me to work a little late in the night.</p>\r\n\r\n<ul>\r\n	<li><strong>Projects I&rsquo;m proud of</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;I am proud of my contribution to the Customer Intelligence project which gave me an opportunity to get noticed and recognized by the CEO of an enterprise-focused Fortune 500&nbsp;organization. I also received an award on client&rsquo;s Tech Day for my contribution to the innovative idea for the Customer Experience project.</p>\r\n\r\n<ul>\r\n	<li><strong>Places I have been</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;I am not an outdoor person but yes I do love to travel. I have been to Tamil Nadu, Kerela and few places in Karnataka.</p>\r\n\r\n<ul>\r\n	<li><strong>My personal life</strong></li>\r\n</ul>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;I am a bit shy kind of a person. I like spending time at a silent place. I am close to very few&nbsp;people. I like listening to music and exploring new places</p>\r\n', '', '', 'Panel', 1, 16, 1, 1, '2017-04-24 11:45:59', 'HGLF3M0DfwFdqWP3AbWPUWA0cD03O61', '0000-00-00 00:00:00', ''),
(2, 'CO-28', 'Bill Gates – A Success Story', 'Bill Gates', 'CEO of  Microsoft', 'USA', '<p>Bill Gates was born on October 28, 1955 in Seattle in a family having rich business, political and community service background. His great-grandfather was a state legislator and a mayor, his grandfather was vice president of national bank and his father was a lawyer.<br />\r\n<br />\r\nBill believed in achieving his goals through hard work. He also believes that if you are intelligent and know how to use your intelligence, you can reach your goals and targets. From his early days Bill was ambitious, competitive and intelligent.&nbsp;These qualities helped him to attain great position in the profession he chose also Bill was deemed by his peers and his teachers as the smartest kid on campus; Bill&rsquo;s parents came to know their son&rsquo;s intelligence and decided to enroll him in a private school, known for its intense academic environment. That was the most important decision in Bill Gate&rsquo;s life where he was first introduced to computers. Bill Gates and his friends were very much interested in computer and formed &ldquo;Programmers Group&rdquo; in late 1968. Being in this group, they found a new way to apply their computer skill in university of Washington. In the next year, they got their first opportunity in Information Sciences Inc. in which they were selected as programmers. ISI (Information Sciences Inc.) agreed to give them royalties, whenever it made money from any of the group&rsquo;s program. As a result of the business deal signed with Information Sciences Inc., the group also became a legal business.<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Bill Gates and his close friend Allen formed a new company of their own, Traf-O-Data. They developed a small computer to measure traffic flow. From this project they earned around $20,000. The era of Traf-O-Data came to an end when Gates left the college. Upon graduating from Lakeside Bill enrolled in Harvard University in 1973, one of the best universities in the country, He didn&rsquo;t know what to do, so he enrolled his name for pre-law. He took the standard freshman courses with the exception of signing up for one of Harvard&rsquo;s toughest mathematics courses. He did well over there, but he couldn&rsquo;t find it interesting too. He spent many long nights in front of the school&rsquo;s computer and the next day asleep in class. After leaving school, he almost lost himself from the world of computers. Gates and his friend Paul Allen remained in close contact even though they were away from school. They would often discuss new ideas for future projects and the possibility of starting a business one fine day. At the end of Bill&rsquo;s first year, Allen came close to him so that they could follow some of their ideas. That summer they got job in Honeywell. Allen kept on pushing Bill for opening a new software company.&nbsp;<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Within a year, Bill Gates dropped out from Harvard. Then he formed Microsoft. Microsoft&rsquo;s vision is &ldquo;A computer on every desk and Microsoft software on every computer&rdquo;. Bill is a visionary person and works very hard to achieve his vision. His belief in high intelligence and hard work has put him where he is today. He does not believe in mere luck or God&rsquo;s grace, but just hard work and competitiveness. Bill&rsquo;s Microsoft is good competition for other software companies and he will continue to stomp out (challenge) the competition until he dies. He likes to play the game of Risk and the game of world domination. His beliefs are so powerful, which have helped him increase his wealth and his monopoly in the industry.<br />\r\n<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Bill Gates is not a greedy person. In fact, he is quite giving person when it comes to computers, internet and any kind of funding. Some years back, he visited Chicago&rsquo;s Einstein Elementary School and announced grants benefiting Chicago&rsquo;s schools and museums where he donated a total of $110,000, a bunch of computers, and provided internet connectivity to number of schools. Secondly, Bill Gates donated 38 million dollars for the building of a computer institute at Stanford University.<br />\r\n<br />\r\n<br />\r\n&quot;<em><strong>such as the meaning&nbsp;of&nbsp;his name is Bill&nbsp;Gates, which means&nbsp;the gate&nbsp;of the&nbsp;money...</strong></em>&quot;</p>\r\n', '', '', 'Panel', 0, 16, 1, 1, '2017-04-29 14:40:47', 'HGLF3M0DfwFdqWP3AbWPUWA0cD03O61', '0000-00-00 00:00:00', ''),
(3, 'CO-28', 'Mukesh Ambani :- India''s Richest Businessman', 'Mukesh Ambani ', 'CEO  of  Reliance Industries', 'INDIA', '<p>The richest person in India and MD and chairman of&nbsp;<a href="https://successstory.com/companies/reliance-industries-limited" target="_blank">Reliance Industries</a>, the largest Indian private sector enterprise, Mukesh Dhirubhai Ambani is a worthy example of business tycoons carrying forward legacy.</p>\r\n\r\n<h2>Biography</h2>\r\n\r\n<p>The elder son of Legendary business leader late Dhirubhai Ambani, he has played a pivotal role in taking Reliance Industries Limited to zenith of success in his illustrious career. Despite the steep competition from rival tycoons like Tatas and Birlas and allegations of business malpractice, Mukesh Ambani continues his success in various spheres of business.</p>\r\n\r\n<p>Along with the tremendous growth of his Fortune Global 500&nbsp;company, Mukesh Ambani has often hogged headlines for his lavish lifestyle and diversification into other industries. Located in South Mumbai, his skyscraper home Antilia&nbsp;has been rated as the world&rsquo;s costliest residential property by prestigious Forbes Magazine. He held the position of the richest Indian for 6 years.</p>\r\n\r\n<h2>Early Life</h2>\r\n\r\n<p>Mukesh Ambani was born on April 19th, 1957 to Indian Business Legend Dhirubhai Ambani and his wife Kokilaben Ambani. He has three siblings, one younger brother, Anil Ambani and two sisters, Deepti Salgaocar and Nina Kothari.</p>\r\n\r\n<p>The family lived in a modest two-bedroom apartment till the late 1970s in Bhuleshwar, Mumbai.</p>\r\n\r\n<h2>Education</h2>\r\n\r\n<p>Mukesh attended the Hill Grange High School at Peddar Road in Mumbai where he was a classmate of Anand Jain, who is his close associate now. His brother also attended the same school as him.</p>\r\n\r\n<p>After completing his high school in Mumbai he got a BE Degree in Chemical Engineering from Institute of Chemical technology at Matunga. He also started his MBA at Stanford University but he had to discontinue his studies to assist his father in the family startup company, Reliance, which was growing fast at the time.</p>\r\n\r\n<h2>Beginning</h2>\r\n\r\n<p>After joining the business, Mukesh Ambani played a pivotal role in growing the business legacy and diversified into new sectors. Under his leadership, Reliance Industries made a foray into sectors like petroleum refining, petrochemicals and gas exploration. He also set up Reliance Infocomm Limited (presently Reliance Communications Limited).</p>\r\n\r\n<h2>Career</h2>\r\n\r\n<p>In 2010, Mukesh Ambani set up the biggest grassroots petroleum refinery plant in Jamnagar. With his initiative, manufacturing capacity of Reliance&#39;s Petrochemicals has grown substantially as per industry sources. The company has also become a leading player in the retail sector, under his leadership and endeavors.</p>\r\n\r\n<p>In his successful and enviable business career, Mukesh Ambani has gone through some turbulent times, too. His rift with sibling Anil Ambani, another business tycoon and chairman of Reliance ADA Group, hogged media attention post the demise of their father. In recent times, the NDA government slammed a $579million fine on RIL for gas production shortfall.</p>\r\n\r\n<p>Mukesh Ambani faced hurdles in the form of business malpractice allegations too. His detractors, including AAP founder Arvind Kejriwal, accused him of interfering in the governance of the country. RIL as well as Mukesh Ambani himself have denied the allegations strongly. The company has also resorted to legal actions over the controversy.</p>\r\n\r\n<p><img alt="" src="https://images.successstory.com/adminimg/image_uploads/content_images/ambani-jio_1457004111.jpg" style="height:310px; width:620px" /></p>\r\n\r\n<p>The numerous acquisitions made by RIL, the acknowledgment from leading business entities, and his firm hold on the throne of India&rsquo;s richest person has not made Mukesh Ambani complacent. Reliance Jio Infocomm, his telecom arm is all set to roll out 4G services in alliance with his sibling Anil Ambani&rsquo;s company.</p>\r\n\r\n<blockquote>&quot; Essentially, whoever is successful, whoever is going to do things that make a difference, is going to be talked about.&quot; -&nbsp;Mukesh Dhirubhai Ambani&nbsp;</blockquote>\r\n\r\n<p>Mukesh Ambani announced a few months back that Reliance Jio Infocomm will launch 4G services in the&nbsp;commercial capacity in 2015, incurring a whopping 70,000 crore investment in India. It will use the pan-India BWA spectrum for the 4G service rollout, which will cover almost 90 percent of urban regions and more than 215,000 villages. It is being deemed as an aggressive move by industry analysts at a time when telecom companies are vying for 4G dominance.</p>\r\n', '', '', 'Panel', 0, 16, 1, 1, '2017-04-29 15:02:23', 'HGLF3M0DfwFdqWP3AbWPUWA0cD03O61', '0000-00-00 00:00:00', ''),
