(6, 'CO-28', 'Steve Jobs was booted from his own company.', 'Steve Jobs', 'CEO', 'USA', '<p>Steve Jobs is an impressive entrepreneur because of his boundless innovations, but also because of his emphatic comeback from an almost irrecoverable failure. Jobs found success in his 20s when Apple became a massive empire, but when he was 30, Apple&rsquo;s board of directors decided to fire him.</p>\r\n\r\n<p>Undaunted by the failure, Jobs founded a new company, NeXT, which was eventually acquired by Apple. Once back at Apple, Jobs proved his capacity for greatness by reinventing the company&rsquo;s image and taking the Apple brand to new heights.</p>\r\n', '', '', 'Panel', 1, 16, 1, 1, '2017-05-03 11:54:56', 'HGLF3M0DfwFdqWP3AbWPUWA0cD03O61', '0000-00-00 00:00:00', '');
