(1, 'CO-28', 1, 'Sitting Floor', 'images/health_wellness/arm.gif', '1.  Sit on the floor with your back up against the wall and your feet hip-width apart.   2.   Pull your shoulder blades together and down, tighten your thighs, and pull your toes back. Be sure that your feet stay straight. Your head should be touching the wall.     Hold for 3 minutes.', 24, '1', '2017-04-12 00:00:00', '2017-04-14 16:00:50'),
(2, 'CO-28', 2, 'Neck Stretch', 'images/health_wellness/neck.gif', '1. Sit or stand upright. Without lifting chin, glide head straight back until a stretch is felt. <br>\r\n2. Hold for slow count of 10. <br>\r\n3. Repeat 3 – 5 times.\r\n', 24, '1', '2017-04-12 00:00:00', '0000-00-00 00:00:00'),
(5, 'CO-28', 4, 'Back Relaxer', 'images/health_wellness/back.gif', 'Just go home', 24, '1', '2017-04-13 14:42:59', '0000-00-00 00:00:00'),
