CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_getWorkAndBirthNotiDetails`(IN `cid` VARCHAR(222), IN `empid` VARCHAR(110), IN `startlimit` INT(3), IN `siteurl` VARCHAR(222))
BEGIN

SELECT DATE_FORMAT(twc.createdDate,'%d %b %Y %h:%i %p') as createdDate,twc.autoId,twc.wishComment,IF(twc.wishImage IS NULL or twc.wishImage='','',CONCAT(siteurl,twc.wishImage)) as wishImage, upd.employeeId,IF(upd.linkedIn='1', upd.userImage, IF(upd.userImage IS NULL or upd.userImage='','',CONCAT(siteurl,upd.userImage))) as userImage,CONCAT(ud.firstName,' ',ud.lastName) as username,ud.designation,ud.location,twc.wishFlag

FROM `Tbl_WishComment` as twc JOIN `Tbl_EmployeeDetails_Master` as ud ON twc.createdby = ud.employeeId JOIN `Tbl_EmployeePersonalDetails` as upd ON ud.employeeId = upd.employeeId JOIN Tbl_ClientDetails_Master as bclient ON twc.clientId = bclient.client_id

WHERE ud.accessibility != 'Admin' AND twc.employeeId= empid AND twc.clientId = cid  AND twc.createdDate BETWEEN DATE_SUB(twc.createdDate,INTERVAL bclient.wishPreDays DAY) AND DATE_ADD(twc.createdDate,INTERVAL bclient.wishPostDays DAY) ORDER BY twc.createdDate DESC;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_getWorkAndBirthNotiListDetails`(IN `cid` VARCHAR(122), IN `empid` VARCHAR(110), IN `limitstart` INT(3))
    NO SQL
    DETERMINISTIC
BEGIN

Select COUNT(1) INTO @Cnt FROM `Tbl_WishComment` as twc JOIN Tbl_ClientDetails_Master as bclient ON twc.clientId = bclient.client_id
JOIN Tbl_EmployeeDetails_Master as emp_master ON emp_master.employeeId=twc.createdBy

WHERE emp_master.accessibility != 'Admin' AND twc.employeeId= empid AND twc.clientId = cid AND twc.createdDate BETWEEN DATE_SUB(twc.createdDate,INTERVAL bclient.wishPreDays DAY) AND DATE_ADD(twc.createdDate,INTERVAL bclient.wishPostDays DAY);

Select companyUniqueId Into @companyId From `Tbl_EmployeeDetails_Master` Where employeeId = empid And clientId = cid;

SELECT DATE_FORMAT(upd.userDOB,'%d %b %Y %h:%i %p') WishDate,upd.employeeId,upd.userImage,CONCAT(ud.firstName, ' ', ud.lastName) username,ud.location,ud.designation, 1 wishFlag, 'N/A' as eventId, 'N/A' as Title

FROM `Tbl_EmployeePersonalDetails` as upd join `Tbl_EmployeeDetails_Master` as ud ON upd.employeeId=ud.employeeId JOIN `Tbl_ClientDetails_Master` as bclient ON ud.clientId = bclient.client_id

WHERE

upd.employeeId != empid 

AND

upd.clientId = cid

AND 

ud.companyUniqueId = @companyId

AND	

( (DAYOFYEAR(upd.userDOB) - DAYOFYEAR(NOW()) BETWEEN -bclient.wishPreDays AND bclient.wishPostDays-1 ) OR IF(MONTH(NOW()) = '01' AND DAY(NOW()) <= bclient.wishPostDays, (DAYOFYEAR( CONCAT(YEAR(NOW()),'-12-31') ) - ( DAYOFYEAR(upd.userDOB) - DAYOFYEAR(NOW()))), (DAYOFYEAR( CONCAT(YEAR(NOW()),'-12-31') ) - ( DAYOFYEAR(NOW()) - DAYOFYEAR(upd.userDOB) ) )) BETWEEN 0 AND bclient.wishPostDays ) 
And ud.employeeId Not In (Select twc.employeeId From Tbl_WishComment twc 
Where twc.createdBy = empid And twc.clientId = cid AND twc.createdDate BETWEEN DATE_SUB(twc.createdDate,INTERVAL bclient.wishPreDays DAY) AND DATE_ADD(twc.createdDate,INTERVAL bclient.wishPostDays DAY) And twc.wishFlag = 1 )


UNION

(SELECT DATE_FORMAT(twc.createdDate,'%d %b %Y %h:%i %p') WishDate,upd.employeeId,upd.userImage,IF(@Cnt =1, CONCAT(ud.firstName, ' ', ud.lastName, ' has wished you.'),  CONCAT(ud.firstName, ' ', ud.lastName, ' and ', @Cnt-1, ' others have wished you.')) as username,ud.location,ud.designation,0 wishFlag, 'N/A' as eventId, 'N/A' as Title FROM `Tbl_WishComment` as twc JOIN `Tbl_EmployeeDetails_Master` as ud ON twc.createdby = ud.employeeId JOIN `Tbl_EmployeePersonalDetails` as upd ON ud.employeeId = upd.employeeId WHERE ud.accessibility != 'Admin' AND twc.employeeId= empid AND twc.clientId = cid order by twc.createdDate desc limit 1)

UNION 

(SELECT DATE_FORMAT(twc.createdDate,'%d %b %Y %h:%i %p') WishDate,upd.employeeId,upd.userImage,CONCAT('Happy Birthday from Vikas Group') as username,ud.location,ud.designation,0 wishFlag, twc.autoId as eventId, 'N/A' as Title FROM `Tbl_WishComment` as twc JOIN `Tbl_EmployeeDetails_Master` as ud ON twc.createdby = ud.employeeId JOIN `Tbl_EmployeePersonalDetails` as upd ON ud.employeeId = upd.employeeId WHERE ud.accessibility = 'Admin' AND twc.employeeId= empid AND twc.clientId = cid order by twc.createdDate desc limit 1)


UNION 

(SELECT if(event.updatedDate = '0000-00-00 00:00:00', DATE_FORMAT(event.eventTime,'%d %b %Y %h:%i %p'),DATE_FORMAT(event.updatedDate,'%d %b %Y %h:%i %p')) WishDate,upd.employeeId,upd.userImage, CONCAT(ud.firstName, ' ', ud.lastName) as 

username,ud.location,ud.designation,6 wishFlag, event_register.eventId as eventId,  event.title as Title FROM `Tbl_C_EventDetails` as event JOIN `Tbl_Analytic_EventRegister` as event_register 

ON event.eventId=event_register.eventId JOIN `Tbl_EmployeeDetails_Master` as ud ON event_register.userUniqueId = ud.employeeId JOIN 

`Tbl_EmployeePersonalDetails` as upd ON ud.employeeId = upd.employeeId WHERE event_register.userUniqueId = empid AND event_register.clientId = cid and 

event.eventTime >= DATE(NOW()) order by event.eventTime desc)

